@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Dispensed20Bills rdf:type owl:Class .
atm:MoneyDispensed rdf:type owl:Class .
atm:AmountLogged rdf:type owl:Class .
atm:ResponseSent rdf:type owl:Class .

atm:hasSerialNumber rdf:type owl:DatatypeProperty ;
    rdfs:domain atm:AmountLogged ;
    rdfs:range xsd:string .

atm:hasResponse rdf:type owl:ObjectProperty ;
    rdfs:domain atm:AmountLogged ;
    rdfs:range atm:ResponseSent .

atm:Dispensed20Bills rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:hasResponse ;
    owl:someValuesFrom atm:ResponseSent ] .

atm:MoneyDispensed rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:hasResponse ;
    owl:someValuesFrom atm:ResponseSent ] .

atm:AmountLogged rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:hasSerialNumber ;
    owl:someValuesFrom xsd:string ] .

atm:AmountLogged rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:hasResponse ;
    owl:someValuesFrom atm:ResponseSent ] .
